import React, { Component } from 'react'

import './home.css'

export default class Home extends Component {
  render(){
    return(
      <div className = "container placement">
        <h1> Hi, I'm Fil. </h1>
        <br />
        <h3> I work at <a href = "pulley.com">Pulley</a> </h3>
      </div>
      )
  }
}
